INSERT INTO `filmy` (`IDfilmu`, `tytul`, `rok_wydania`, `czas_trwania`, `opis`, `plakat`) VALUES
(1, 'The VelociPastor', 2017, '01:15:00', 'Catholic priest Doug Jones witnesses his parents die in a car fire. He travels to China on a spiritual journey and comes across ninjas searching for an artifact said to turn people into the Dragon Warrior. After becoming infected by the artifact, Doug begins having nightmares and goes out into the forest late at night as he transforms into a dinosaur. He saves Carol, a prostitute, from a thug.\r\n\r\nWaking up in Carol\'s bed naked, with no memory of the night before, Doug initially believes they had sex, but after Carol tells him what happened he realizes the truth. Unpersuaded by her suggestion to use his new power to fight crime and get rid of people they believe are beyond spiritual salvation, he returns to the church for confessions; speaking to Frankie Mermaid, Carol\'s pimp, he learns Mermaid is the one responsible for killing Doug\'s parents.\r\n\r\nEnraged, Doug proceeds to kill Mermaid and, now convinced about her plan to fight crime, returns to Carol needing her assistance. Father Stewart, learning of Doug\'s new power, encourages Doug to lose it and stop killing. He takes him to see Altair, an exorcist, hoping to remove Doug\'s power. In a flashback, we learn Father Stewart saw a war buddy shot while off guard and that his love interest was killed in an accident. Back in the present, the exorcism fails and Doug transforms, taking one of Father Stewart\'s eyes.\r\n\r\nReturning to Carol, Doug is confronted by ninjas. Father Stewart wakes up in a camp of drug-dealing Christian ninjas, led by Wei Chan who plans to sell highly addictive cocaine to people and then cut off supplies. Wei Chan hopes this will lead the addicts to turn to the church where he will eventually take over and use them as his army. Father Stewart rejects this idea and is killed. Doug and Carol are confronted by ninjas and plan to stop Wei Chan.\r\n\r\nDoug is stopped by Sam the White Ninja, who he later realizes is his brother. Doug catches Sam off guard and uses telekinesis to take Sam\'s sword and kill him. Doug and Carol fight off more ninjas and are badly wounded. Doug, fighting off the remaining ninjas, is shot by Wei Chan with an arrow containing anti-venom to stop his transformation. Doug\'s hands are immune to the anti-venom and he proceeds to kill Wei Chan. Doug carries Carol to the hospital where she recovers.\r\n\r\nDoug, no longer a priest with a bounty on his head, plans on traveling the world with Carol and continuing their original idea of killing off criminals.', );
INSERT INTO `filmy` (`IDfilmu`, `tytul`, `rok_wydania`, `czas_trwania`, `opis`, `plakat`) VALUES
(2, 'Nie zadzieraj z fryzjerem', 2008, '01:53:00', 'Zohan Dvirr jest najskuteczniejszym agentem Mosadu. Ale bardzo chcia zosta fryzjerem. Do realizacji marze nie doszo, bo rodzice si nie godzili, poniewa sta si popularny. Jego gwnym wrogiem jest terrorysta zwany Duchem. Zohan podczas akcji w Palestynie pozoruje wasn mier. Trafia do Nowego Jorku. W celu lepszego ukrycia si zmienia swj wygld i przybiera pseudonim Scrappy Coco. Tu, nie mogc dosta wymarzonej pracy w salonie fryzjerskim Paula Mitchella, podejmuje prac w salonie fryzjerskim nalecym do Palestynki. Mimo emigracji, nawet w USA dogoniy go skutki niezamknitych spraw z przeszoci, ktrym bdzie musia stawi czoa.', );
INSERT INTO `filmy` (`IDfilmu`, `tytul`, `rok_wydania`, `czas_trwania`, `opis`, `plakat`) VALUES
(3, 'Borat: Podpatrzone w Ameryce, aby Kazachstan rs w si, a ludzie yli dostatniej', 2006, '01:22:00', 'Film jest oparty na ywioowym popisie brytyjskiego komika Sachy Barona Cohena, w ktrym w formie parodii filmu dokumentalnego przedstawiono Borata Sagdijewa, dziennikarza kazachskiej pastwowej telewizji, ktry w celu poprawy losu swojego narodu chce w Ameryce zasign wiedzy o kulturze amerykaskiej. Wyrusza on ze swej wioski w Kazachstanie do Ameryki, aby zrobi film dokumentalny o tym kraju.\r\n\r\nPodczas ogldania jednego z odcinkw Sonecznego patrolu zakochuje si w grajcej w nim Pameli Anderson. Zakochany Borat Sagdijew wybiera si do Kalifornii, gdzie ma nadziej spotka swoj ukochan i polubi j.', );
INSERT INTO `filmy` (`IDfilmu`, `tytul`, `rok_wydania`, `czas_trwania`, `opis`, `plakat`) VALUES
