(5, 'To', 2017, '02:15:00', 'Akcja toczy si w fikcyjnym miasteczku Derry w stanie Maine, gdzie grupa dzieci przeladowana jest przez morderczego klauna Pennywise\'a.', );
INSERT INTO `filmy` (`IDfilmu`, `tytul`, `rok_wydania`, `czas_trwania`, `opis`, `plakat`) VALUES
(6, 'Matrix', 1999, '02:16:00', 'Thomas A. Anderson (Keanu Reeves) wiedzie podwjne ycie. Zawodowo pracuje jako programista komputerowy w firmie MetaCortex, natomiast w yciu prywatnym jest hakerem komputerowym o pseudonimie Neo. Seria niewytumaczalnych i zaskakujcych zjawisk prowadzi go do kontaktu z grup, na czele ktrej stoi tajemniczy Morfeusz (Laurence Fishburne), uznawany przez wadze za przestpc i terroryst. Wyjania on Neo, czym jest Matrix, po czym oferuje pokazanie prawdziwego, niezakamanego wiata. Tam Neo na wasne oczy przekonuje si, e yje w postapokaliptycznym wiecie. Ludzie wymylili sztuczn inteligencj (SI), jednake maszyny wyrway si spod ich kontroli i zwrciy si przeciwko twrcom. Aby odci je od energii sonecznej, ludzie spowili niebo czarnym smogiem. Decyzja ta okazaa si fatalna w skutkach  maszyny jako rdo energii wybray ludzi, wic ich w programie zwanym Matriksem, symulujcym wiat z roku 1999. Istnieje jednak grupa ludzi niepodczonych. Wrd nich jest midzy innymi zaoga statku Nabuchodonozor, ktrej kapitanem jest Morfeusz.\r\n\r\nMorfeusz uwalnia Neo z Matriksa, wierzc, e jest on Wybracem, przepowiedzianym przez Wyroczni wybawicielem i czowiekiem, ktry zakoczy wojn i przyniesie pokj. Sam Neo jest raczej sceptyczny wobec swoich umiejtnoci  pod okiem Morfeusza stopniowo uczy si jednak nagina i ama reguy systemu komputerowego.\r\n\r\nDla maszyn ludzie wyzwoleni, nieprzynoszcy energii, a jedynie uwalniajcy innych, s szkodnikami. Istnieje specjalna grupa programw, zwanych agentami. Na ich czele stoi agent Smith. S oni stranikami Matriksa, cigaj i zabijaj osoby, ktrych wirtualne ego wysyane jest za pomoc pirackiego sygnau. Agenci odznaczaj si nadnaturaln si i szybkoci, s zdolni do unikania pociskw i przejmowania ciaa dowolnego czowieka yjcego w Matriksie. S niemiertelni, lecz zasady ich bytu i zachowa zostay ograniczone reguami programu komputerowego. Wybraniec mgby je jednak zama i pokona agentw.\r\n\r\nNeo spotyka si z Wyroczni, ktra wskazuje mu jego ciek. Bdzie on musia podj decyzj  wybr pomidzy zachowaniem swojego ycia a uratowaniem Morfeusza. Wyrocznia sugeruje, e Neo wybracem nie jest, przynajmniej jeszcze nie. Wkrtce potem Cypher, jeden z czonkw zaogi Nabuchodonozora, preferujcy ignorancj zamiast prawdy, zdradza Morfeusza, ktrego pojmuj agenci. Chc wydoby z niego kod dostpu do Syjonu  jedynego miasta ludzi, do ktrego maszyny nie maj dostpu. Neo dokonuje wyboru przepowiedzianego przez wyroczni  wyrusza wraz z Trinity na ratunek Morfeuszowi. Udaje si go uwolni i bezpiecznie doprowadzi do wyjcia z Matriksa. Na przeszkodzie po raz kolejny staje jednak agent Smith  po ucieczce Trinity przestrzeliwuje kabel, pozwalajcy na bezpieczne przejcie do prawdziwego wiata. Neo podejmuje walk z agentem, ktry ginie w obecnym ciele pod koami pocigu. Wkrtce pojawia si w nowym wcieleniu, zmuszajc Neo do ucieczki.\r\n\r\nW tym samym czasie w prawdziwym wiecie maszyny przeprowadzaj atak na statek Morfeusza. Nie moe on odpali adunkw niszczcych ukady elektroniczne w sytuacji, gdy Neo jest podczony do Matriksa. Sytuacj komplikuje fakt, e niedoszy Wybraniec zostaje postrzelony i zabity przez agenta. Trinity nie moe pogodzi si ze mierci ukochanego  jej pocaunek w prawdziwym wiecie przywraca go do ycia w Matriksie. Zmartwychwstay Neo doznaje olnienia, staje si wybracem. Zatrzymuje lecce w jego stron kule, a nastpnie niszczy agenta Smitha. Po powrocie Neo do prawdziwego wiata Morfeusz odpala adunki elektromagnetyczne niszczce maszyny oraz elektroniczne ukady Nabuchodonozora.\r\n\r\nWkrtce potem Neo powraca do Matriksa  grozi maszynom, e zrobi wszystko, by otworzy ludziom oczy i wyzwoli spod panowania robotw.', );
INSERT INTO `filmy` (`IDfilmu`, `tytul`, `rok_wydania`, `czas_trwania`, `opis`, `plakat`) VALUES
(7, 'Warcraft: Pocztek', 2016, '02:03:00', 'Kraina Azeroth staje w obliczu konfliktu, kiedy najedaj j istoty z innego wiata: orkowie, poszukujcy nowego domu, kiedy ich wasny ginie. Gdy orkowie przechodz przez portal do innego wiata, kolonizuj go w caoci dla siebie i niszcz pozostae rasy. Po przeciwnej stronie znajduj si ludzie, ktrzy musz walczy o swoje ycie, rodziny i los caej krainy.', );
INSERT INTO `filmy` (`IDfilmu`, `tytul`, `rok_wydania`, `czas_trwania`, `opis`, `plakat`) VALUES
(8, 'Zielona mila', 2000, '01:21:00', 'Zielona mila jest histori opowiedzian przez wiekowego Paula Edgecomba (Dabbs Greer) w domu spokojnej staroci. Po obejrzeniu filmu pt. Top Hat przypomina sobie pewne zdarzenia i opowiada swojej przyjacice, Elaine Connely (Eve Brent), o niezwykym winiu, ktrego spotka w lecie 1935 roku, gdy pracowa jako stranik winiw skazanych na kar mierci w wizieniu w Luizjanie. Blok, na ktrym pracowa, nazywany by zielon mil ze wzgldu na kolor linoleum lecego na pododze. Niemym bohaterem celi mierci jest rwnie krzeso elektryczne (zwane Star Iskrw, ang. Old Sparky), oczekujce na swoje ofiary.\r\n\r\nPewnego dnia na oddzia trafia olbrzymi, czarnoskry John Coffey (Michael Clarke Duncan), oskarony o zamordowanie dwch biaych dziewczynek. Coffey okazuje si agodnym olbrzymem, bojcym si ciemnoci i czasami paczcym. Niedugo ujawnia swe niezwyke zdolnoci uzdrawiajce przez wyleczenie Paula Edgecomba (Tom Hanks) z zapalenia pcherza moczowego oraz oywienie myszy.\r\n\r\nPercy Wetmore (Doug Hutchison) jest wrednym, sadystycznym stranikiem lubicym sprawia cierpienie innym. Ma rwnie wysoko postawionego wujka (jest bratankiem ony gubernatora stanu), ktry zaatwi mu t prac i nie bardzo mona pozby si go z obecnego stanowiska. Za pozwolenie wykonania wyroku obiecuje przenie si na inne miejsce. Podczas wykonania wyroku Percy umylnie nie moczy gbki, umoliwiajcej lepszy przepyw prdu, by zobaczy efekty. Skazany wizie, Eduard Delacroix (Michael Jeter), umiera przez do dugi czas w strasznych mczarniach, a take zapala si, co wywouje panik wrd wiadkw.\r\n\r\nStranicy wykorzystuj zdolnoci uzdrawiajce Johna, by wyleczy on naczelnika wizienia. Po powrocie do wizienia John przenosi jej chorob na Percyego Wetmorea, by go ukara za to, co zrobi z Eduardem Delacroix. Pod wpywem Coffeya kompletnie oderwany od rzeczywistoci Percy zabija jednego z winiw  Dzikiego Billa (Sam Rockwell), a nastpnie zostaje umieszczony w zakadzie dla obkanych. Paul utwierdza si w przekonaniu, e John jest niewinny, a proces by czysto formalny (znaleziono go tulcego do siebie martwe dziewczynki  czarny musi by winny, cho w rzeczywistoci wcale ich nie zabi, tylko znalaz i prbowa pomc za pomoc swoich zdolnoci, prawdziwym morderc by Dziki Bill), ale nie ma na to dowodw. Egzekucja musi si odby. Przed mierci John oglda ten sam film, ktry oglda Paul na pocztku filmu. Bya to ostatnia egzekucja, w ktrej uczestniczyli Paul i Brutus, po tym zdarzeniu przenieli si do pracy w domu poprawczym.', );
INSERT INTO `filmy` (`IDfilmu`, `tytul`, `rok_wydania`, `czas_trwania`, `opis`, `plakat`) VALUES
(9, 'Indiana Jones i ostatnia krucjata', 1989, '02:07:00', 'Film rozpoczyna si w 1912 roku, gdy Indiana Jones ma ok. 15 lat i jest skautem. Szuka krzya Coronado w Utah. Chce odda znaleziony skarb do muzeum, ale cigaj go inni poszukiwacze. Indy ucieka przed nimi przez pocig, ktry przewozi zwierzta (ma bliskie spotkania z nosorocem i wami), ale ostatecznie udaje mu si uciec do domu, w ktrym spotyka swojego ojca. Wtedy wchodz do domu jego rywale przebrani za pracownikw muzeum i odbieraj od niego krzy. Jednak upr i sia Indyego wzbudza podziw ich szefa (ktry podejrzanie przypomina dorosego Indyego) i dlatego w nagrod oddaje mu swj kapelusz\r\n\r\nW 1938 roku Indiana Jones otrzymuje propozycj uczestniczenia w wyprawie zorganizowanej w celu znalezienia w. Graala. Pocztkowo nie chce bra udziau w poszukiwaniu chrzecijaskiej relikwii. Zmienia zdanie, gdy dowiaduje si, e jeden z czonkw ekspedycji ju zagin i e jest nim jego ojciec, Henry Jones (Sean Connery). Cho ojciec i syn nie widzieli si od lat, Indiana decyduje si jecha do Wenecji, gdzie znajduje si grobowiec redniowiecznego rycerza, ktry dotar do cudownego kielicha. Towarzyszy mu Marcus Brody. Napotyka austriack Doktor Els Schneider, ktra na zlecenie nazistw ma przechwyci Graala. Mami Indyego propozycj wsppracy.\r\n\r\nWkrtce wszyscy troje przeszukuj grobowiec. Atakuj ich tajemnicze indywidua, ktre porywaj Brody\'ego i cigaj Els i Jonesa na rzece. Po pocigu jeden z nich  Kazim  mwi Jonesowi, by nie szuka Graala. Jones i Elsa wyruszaj jednak do Austrii, gdzie spotykaj ojca Indyego i nazistw pod wodz historyka Waltera Donovana i generaa Vogela. Wtedy te wychodzi na jaw, e Elsa jest ich wsplniczk. Podpaleniu ulega dom, skd udaje si im wkrtce uwolni.\r\n\r\nPo widowiskowej uciecze przed Austriakami docieraj do Niemiec, gdzie odnajduj dziennik, w ktrym zaznaczone jest miejsce spoczynku Graala. Indy spotyka te Adolfa Hitlera i przypadkowo dostaje od niego autograf. Pniej usiuje wraz z ojcem uciec niemieckim Zeppelinem, ten jednak zawraca z powrotem do Niemiec. Po walce z nazistami Jonesom udaje si o wasnych siach wydosta z terenu III Rzeszy.\r\n\r\nTymczasem Brody zostaje porwany przez hitlerowcw. Docieraj do pastwa Hatay. W lad za nimi docieraj Jonesowie i ich stary przyjaciel  Sallah. Atakuj nazistw (przedtem Donovan i Elsa oddalili si na chwil od Vogela i jego onierzy oraz Brody\'ego). Rozpoczyna si strzelanina, w ktrej udzia bior nazici i ludzie Kazima, ktry zostaje postrzelony kilkanacie razy, w wyniku czego umiera. Chwil pniej ma miejsce widowiskowa walka w czogu midzy Vogelem i jego ludmi a czwrk gwnych bohaterw. Ostatecznie czog wraz z Vogelem i Indian spada w przepa. Vogel ginie, Indy\'emu udaje si cudem przey.\r\n\r\nJonesowie, Sallah i Brody docieraj do starej budowli, w ktrej spoczywa Graal. S tam ju Elsa i Donovan oraz ocalali nazici. By dotrze do Graala, miaek musi przej trzy niezwykle trudne prby  test na wierno Bogu. Donovan miertelnie rani ojca Indiany  tylko Graal moe go uzdrowi, a Indy nie ma wyjcia  musi znale Graala. Udaje mu si omin ruchome brzytwy, wystuka imi Jehowa (zwracajc uwag na acisk pisowni) na kamiennych pytkach i przej po niewidzialnym mocie. W lad za nim podaj Donovan i Elsa. Docieraj do starej krypty. Spotykaj tam starego rycerza i kilkadziesit kielichw, jeden z nich to Graal. Donovan bierze faszywy i w cigu kilku sekund zaczyna si gwatownie starze i w kocu obraca si w proch. Jones wybiera prawdziwy kielich. Niemiertelno zyska jednak jedynie wtedy, gdy nie wyniesie Graala z krypty  musi jednak ratowa ojca, co udaje mu si. Jednak przez swoj chciwo Elsa amie zakaz rycerza i spada w przepa, a wraz z ni Graal.\r\n\r\nGdy Brody, Sallah i Jonesowie wychodz z krypty, Henry Jones mwi Sallahowi i Brody\'emu, ku wielkiej uciesze Sallaha, e Indy naprawd nazywa si Henry Jones Junior, a przydomek Indiana ma po psie.', );

